function parseCSV(e){e=e.split("\n");const s=e[0].split(",");return e.slice(1).map(e=>{const t=e.split(","),a={};return s.forEach((e,s)=>{a[e.trim()]=t[s].trim()}),a})}function shuffleArray(s){for(let e=s.length-1;0<e;e--){var t=Math.floor(Math.random()*(e+1));[s[e],s[t]]=[s[t],s[e]]}return s}fetch("https://docs.google.com/spreadsheets/d/e/2PACX-1vQlBwUvFAaHZIF_qkWGa-1chrXhLWOgH4W1wfk6obyT-U6e4p42J-LQDLuImQ8JT3OT35qqDVNPWOEW/pub?output=csv").then(e=>e.text()).then(e=>{e=shuffleArray(parseCSV(e));const t=document.getElementById("flashcards__container");e.forEach(e=>{const s=document.createElement("div");s.classList.add("flashcards__card"),s.innerHTML=`
        <div class="flashcards__card--question">${e.question}</div>
        <div class="flashcards__card--answer">${void 0!==e.answer?e.answer:""}</div>
      `,s.addEventListener("click",()=>{s.classList.toggle("flipped")}),t.appendChild(s)})});